import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <form>
          <table>
            <tr>
              <td><input type="text" name="Name"/></td>
            </tr>
          </table>
        </form>
      </header>
    </div>
  );
}

export default App;
